const express = require("express");
const fs = require("fs");
const path = require("path");
const puppeteer = require("puppeteer-core");
const chromium = require("@sparticuz/chromium");

const app = express();
app.use(express.json());
app.use(express.urlencoded({ extended: true }));
app.use(express.static(path.join(__dirname, "public")));
app.get("/", (req, res) => {
  res.send("OK");
});

/* =========================
   INVOICE GENERATION
========================= */
app.post("/generate-invoice", async (req, res) => {
  try {
    const { client_name, invoice_no, desc, qty, price } = req.body;

    let rows = "";
    let subtotal = 0;

    desc.forEach((d, i) => {
      const q = Number(qty[i]);
      const p = Number(price[i]);
      const total = q * p;
      subtotal += total;

      rows += `
        <tr>
          <td>${d}</td>
          <td>${q}</td>
          <td>${p}</td>
          <td>${total.toFixed(2)} AED</td>
        </tr>
      `;
    });

    const date = new Date().toLocaleDateString("en-GB");

    const logoBase64 = "data:image/png;base64,";

    let html = fs.readFileSync(
      path.join(__dirname, "invoice.html"),
      "utf8"
    );

    html = html
      .replace("{{client_name}}", client_name)
      .replace("{{table_rows}}", rows)
      .replace("{{subtotal}}", subtotal.toFixed(2))
      .replace("{{date}}", date)
      .replace("{{invoice_no}}", invoice_no)
      .replace("{{LOGO_BASE64}}", logoBase64);

    //  FIXED PUPPETEER LAUNCH
    const browser = await puppeteer.launch({
      args: chromium.args,
      executablePath: await chromium.executablePath(),
      headless: true,
    });

    const page = await browser.newPage();
    await page.setContent(html, { waitUntil: "networkidle0" });

    const pdfBuffer = await page.pdf({
      format: "A4",
      printBackground: true,
    });

    await browser.close();

    res.set({
      "Content-Type": "application/pdf",
      "Content-Disposition": "attachment; filename=invoice.pdf",
    });
    res.send(pdfBuffer);

  } catch (err) {
    console.error(err);
    res.status(500).send("Invoice generation failed");
  }
});


